import React, { Component } from 'react';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';
import MapContainer from './MapContainer/MapContainer';
import RestaurauntsList from './RestaurantContainer/RestaurauntsList';

class MapAndRestaurauntContainer extends Component {
	render() {
		return (
			<Row>
				<main className='map_restauraunt_wrapper'>
					<Col sm={12} md={6} lg={7}>
						<section>
							<MapContainer />
						</section>
					</Col>
					<Col sm={12} md={6} lg={5}>
						<section>
							<RestaurauntsList />
						</section>
					</Col>
				</main>
			</Row>
		);
	}
}

export default MapAndRestaurauntContainer;
